import React from 'react';
import { useNavigate } from 'react-router-dom';
import './NavigationLogout.css'; // Assuming you're styling it separately

const NavigationLogout = () => {
  const navigate = useNavigate();

  const handleLogout = () => {
    localStorage.removeItem("jwt");
    localStorage.removeItem("role");
    localStorage.removeItem("currentUser");
    navigate("/");
  };

  const handleHome = () => {
    navigate("/");
  };

  const handleFeatures = () => {
    navigate("/featureSection");
  };

  const handleAboutUs = () => {
    navigate("/aboutUs");
  };

  const handleBackToDashboard = () => {
    const role = localStorage.getItem("role");
    if (role === "ADMIN") {
      navigate("/adminPage");
    } else if (role === "USER") {
      navigate("/userHome");
    } else if (role === "MANAGER") {
      navigate("/manager");
    } else {
      alert("Session expired or invalid role.");
      navigate("/");
    }
  };

  const isLoggedIn = localStorage.getItem("jwt");

  return (
    <div className="nav">
      <nav className="navbar">
        {/* Left links */}
        <ul className="nav-left">
          <div className="logo">AdvancedToDo</div>
          <li onClick={handleHome}>Home</li>
          <li onClick={handleFeatures}>Features</li>
          <li onClick={handleAboutUs}>About Us</li>
        </ul>

        {/* Right buttons */}
        <div className="nav-right">
          <button className="logout-btn" onClick={handleLogout}>
            LOGOUT
          </button>
        </div>
      </nav>
    </div>
  );
};

export default NavigationLogout;
